import { ApplicationConfig, importProvidersFrom } from '@angular/core';
import { provideRouter, Routes } from '@angular/router';
import { HttpClientModule } from '@angular/common/http';
import { ReactiveFormsModule } from '@angular/forms';

// Componentes
import { SplashScreenComponent } from './components/splash-screen/splash-screen.component';
import { DishListComponent } from './components/dish-list/dish-list.component';
import { DishFormComponent } from './components/dish-form/dish-form.component';
import { CheckoutComponent } from './components/checkout/checkout.component';
import { OrderTrackerComponent } from './components/order-tracker/order-tracker.component';
import { AdminDashboardComponent } from './components/admin-dashboard/admin-dashboard.component';

// --- ADICIONE ESTA LINHA ---
import { KitchenOrderComponent } from './components/kitchen-order/kitchen-order.component';
// (Confirme se o caminho './components/kitchen-order/kitchen-order.component' está correto)

const routes: Routes = [
  // ... (suas outras rotas) ...
  
  // Rota Admin (que você está adicionando)
  { path: 'admin/kitchen', component: KitchenOrderComponent }, // Agora o Angular sabe quem é esse componente

  // ... (resto das rotas) ...
];

export const appConfig: ApplicationConfig = {
  providers: [
    provideRouter(routes),
    importProvidersFrom(HttpClientModule, ReactiveFormsModule)
  ]
};
